import base64
fileDict = {}
def getFile(fileCodeName: str):
    global fileDict
    decodecFileContent = base64.b64decode(fileDict[fileCodeName]).decode()
    return decodecFileContent

def getFileInBase64(fileCodeName: str):
    global fileDict
    return fileDict[fileCodeName]


